// Débugger la structure du message vocal
const voiceMessage = $json;

// Afficher la structure complète pour comprendre
console.log('Structure complète:', JSON.stringify(voiceMessage, null, 2));

// Extraire le file_id de différentes façons possibles
const fileId = voiceMessage?.voice?.file_id || 
               voiceMessage?.message?.voice?.file_id ||
               voiceMessage?.file_id ||
               null;

if (!fileId) {
  throw new Error('Impossible de trouver le file_id du message vocal');
}

return [{
  json: {
    file_id: fileId,
    original_data: voiceMessage
  }
}];
